      `${import_raydium_sdk_v2.API_URLS.SWAP_HOST}/compute/swap-base-in?inputMint=${inputMint}&outputMint=${outputMint}&amount=${this.tokenAmountIn.raw.toString()}&slippageBps=${this.slippage}&txVersion=${txVersion}`
